import React from "react";

function LandingPage() {
  return (
    <>
      <div>LandingPage</div>
      <a href="/homepage">Home</a>
      <br />
      <a href="/login">Login</a>
      <br />
      <a href="/signup">Signup</a>
    </>
  );
}

export default LandingPage;
